=head1 DESCRIPTION

A list of documents that could not be removed from an Amazon Q Business
index. Each entry contains an error message that indicates why the
document couldn't be removed from the index.

=head1 ATTRIBUTES


=head2 DataSourceId => Str

The identifier of the Amazon Q Business data source connector that
contains the failed document.


=head2 Error => L<Paws::QBusiness::ErrorDetail>

An explanation for why the document couldn't be removed from the index.


=head2 Id => Str

The identifier of the document that couldn't be removed from the Amazon
Q Business index.



